import React from 'react';
import { Link } from 'react-scroll';

const Navbar = () => (
  <nav className="sticky top-0 bg-white shadow-md p-4 flex justify-between items-center">
    <div className="flex items-center gap-4">
      <h1 className="font-bold text-lg text-blue-700">Vasudha Maddi</h1>
    </div>
    <div className="flex gap-6 font-semibold">
      <Link to="hero" smooth={true} duration={500} className="hover:text-blue-600 cursor-pointer">Home</Link>
      <Link to="skills" smooth={true} duration={500} className="hover:text-blue-600 cursor-pointer">Skills</Link>
      <Link to="projects" smooth={true} duration={500} className="hover:text-blue-600 cursor-pointer">Projects</Link>
      <Link to="experience" smooth={true} duration={500} className="hover:text-blue-600 cursor-pointer">Experience</Link>
      <Link to="education" smooth={true} duration={500} className="hover:text-blue-600 cursor-pointer">Education</Link>
      <Link to="resume" smooth={true} duration={500} className="hover:text-blue-600 cursor-pointer">Resume</Link>
      <Link to="contact" smooth={true} duration={500} className="hover:text-blue-600 cursor-pointer">Contact</Link>
    </div>
  </nav>
);

export default Navbar;
